import React from 'react';
import './OurServices.css';

const OurServices = () => {
  return (
    <div className="services-container">
      <h1 className="services-heading">Our Services</h1>
      <p className="services-description">
        GymFluencer offers 5 essential services to help you achieve your fitness goals with ease and flexibility.
      </p>
      <div className="services-images">
        <img src="./assets/images.jpeg" alt="Gym 1" className="gym-image"/>
        <img src="./assets/images2.jpg" alt="Gym 2" className="gym-image"/>
        <img src="./assets/images3jpg.jpg" alt="Gym 3" className="gym-image"/>
        <img src="./assets/images4.jpeg" alt="Gym 4" className="gym-image"/>
        <img src="./assets/images5.jpeg" alt="Gym 5" className="gym-image"/>
      </div>
    </div>
  );
};

export default OurServices;
